import styled from 'styled-components'


export default styled.div`
/* background-color: var(--primary); */
grid-area: VT;
display: flex;
align-items: center;
flex-direction: column;
/* border: solid 1px gray; */

div.LastVote{
  display:flex;
flex-direction: column;
background-color: var(--primary);
height:150px;
width:300px;
}
div.votes{
  width:300px;
  height:150px;
  background-color: var(--secundary);

}
div#button{
  margin-top: -20px;
}
button{
  padding: 6px;
}
#disable{
  display: none;
}
h1{
  font-size:20px;
}
#favorable{
  background-color: green;
}
#against{
  background-color: red;
}
div#favorVotes{
  width:48%;
  float: left;
}
div#againstVotes{
  width:48%;
  float: right;
}
h3{
  width:100%;
}

`
